import React from "react";
class NavBar extends React.Component {
  state = {
    array: [
      {
        type: "Stays",
        icon: "fa-bed",
        active: true,
      },
      {
        type: "Flights",
        icon: "fa-plane",
        active: false,
      },
      {
        type: "Car rentals",
        icon: "fa-car",
        active: false,
      },
      {
        type: "Attractions",
        icon: "fa-bed",
        active: false,
      },
      {
        type: "Airport taxis",
        icon: "fa-taxi",
        active: false,
      },
    ],
  };
  newArray = () => {
    let current = this.state.array;
    this.setState({
      current,
    });
  };
  render() {
    console.log(this.state.type);
    return (
      <>
        <div>
          {array.map((item, index) => {
            return (
              <div key={index}>
                {item.type}
                <></>
                <span>{item.active} </span>
              </div>
            );
          })}
        </div>
      </>
    );
  }
}

export default NavBar;
